import React from 'react'

const Entity = props => {

    const radius = 10
    color = 'yellow'

    const style = {
        height: `${radius*2}px`,
        width: `${radius*2}px`,
        backgroundColor: color,
        borderRadius: "50%",
    }

    return (
        <div className="entity planet" style={style}></div>
    )
}
